import Navbar from '../components/Navbar';

const Home = () => {
  return (
    <>
      <Navbar />

      <section className="bg-black h-96 flex flex-col items-center justify-center">
        <h1 className="text-white">ProVision: Aprende a Manejar tu Negocio</h1>
        <p className="text-white">Con ProVision podrás gestionar y automatizar tus procesos empresariales
        de manera más sencilla y eficiente</p>
      </section>
    
    </>
  );
};

export default Home;
